import React from 'react'
import Barchart from './Barchart'

function Category() {
  const data = [
    {name: "category",value:10},
    {name:"Female",value:15},
    {name:"Required",value:3},
  ];
  return (
    <div>
      <Barchart
      width={500}
      height={600}
      data={data}
      margin={{
        top: 5,
        right: 30,
        left:30,
        bottom:20
      }}
      barSize={20}>

      </Barchart>
    </div>
  )
}

export default Category
